/*!50003 CREATE*/ /*!50020 DEFINER=`root`@`localhost`*/ /*!50003 PROCEDURE `creditOperation`(
IN gradeName varchar(15),
IN shapeName varchar(10),
IN sizeNum float,
IN size2Num float,
IN qualityName varchar(7),
IN rootName varchar(10),
IN makeName varchar(50),
IN weight float(9,3),
IN quantity int,
IN lengthMM int,
IN godownName varchar(20),
IN rackName varchar(20))
begin
declare materialID, producerID, locatorID, theMSID, cnt int;
 call getMID(gradeName, shapeName, sizeNum, size2Num, materialID);
 call getMakeID(makeName, producerID);
 call getLocationID(godownName, rackName, locatorID);
 call getMSID(materialID, qualityName, rootName, producerID, theMSID);
insert into credit (date, time, msid, locationid, wt, qty, length) values (sysdate(), curtime(), theMSID, locatorID, weight, quantity, lengthMM);
select count(*) into cnt from inventory where msid = theMSID and locationid = locatorID and length = lengthMM;
if cnt = 0 then
 insert into inventory (msid, locationid, wt, qty, length) values (theMSID, locatorID, weight, quantity, lengthMM);
else
 update inventory set wt = wt + weight, qty = qty + quantity where msid = theMSID and locationid = locatorID and length = lengthMM;
end if;
end */;;
